hwMeta.bodyText:
If(clk._onRisingEdge(),
    If(rst_n._eq(0),
        readRegEmpty(1),
        readDataPending(0)
    ).Else(
        readRegEmpty(readRegEmpty_next),
        readDataPending(readDataPending_next)
    )
)

If(clk._onRisingEdge(),
    If(rst_n._eq(0),
        readRegEmpty(1),
        readDataPending(0)
    ).Else(
        readRegEmpty(readRegEmpty_next),
        readDataPending(readDataPending_next)
    )
)

Switch(insertFsm)\
    .Case(insertFsm_t.idle,
        If(clean_vld._eq(1),
            insertFsm_next(insertFsm_t.cleaning)
        ).Elif((insert_vld | lookup_vld | delete_vld)._eq(1),
            insertFsm_next(insertFsm_t.lookup)
        ).Else(
            insertFsm_next(insertFsm)
        ))\
    .Case(insertFsm_t.cleaning,
        If(cleanupAddr._eq(31),
            insertFsm_next(insertFsm_t.idle)
        ).Else(
            insertFsm_next(insertFsm)
        ))\
    .Case(insertFsm_t.lookup,
        If((sig_tables_0_lookup_rd & sig_tables_1_lookup_rd)._eq(1),
            insertFsm_next(insertFsm_t.lookupResWaitRd)
        ).Else(
            insertFsm_next(insertFsm)
        ))\
    .Case(insertFsm_t.lookupResWaitRd,
        If((sig_tables_0_lookupRes_vld & sig_tables_1_lookupRes_vld)._eq(1),
            insertFsm_next(insertFsm_t.lookupResAck)
        ).Else(
            insertFsm_next(insertFsm)
        ))\
    .Default(
        If(lookupOrigin._eq(2),
            insertFsm_next(insertFsm_t.idle)
        ).Elif(lookupOrigin._eq(1) & lookupRes_rd._eq(1),
            insertFsm_next(insertFsm_t.idle)
        ).Elif(~(lookupOrigin._eq(1)) & (sig_tables_0_insert_rd & sig_tables_1_insert_rd)._eq(1) & insertFinal._eq(1),
            insertFsm_next(insertFsm_t.idle)
        ).Elif(~(lookupOrigin._eq(1)) & (sig_tables_0_insert_rd & sig_tables_1_insert_rd)._eq(1) & (~insertFinal)._eq(1),
            insertFsm_next(insertFsm_t.lookup)
        ).Else(
            insertFsm_next(insertFsm)
        ))

If((lookupResRead & (sig_tables_0_lookupRes_vld & sig_tables_1_lookupRes_vld))._eq(1),
    If((sig_tables_0_lookupRes_found | sig_tables_1_lookupRes_found)._eq(1),
        targetOH_next(Concat(sig_tables_1_lookupRes_found, sig_tables_0_lookupRes_found))
    ).Elif((~sig_tables_0_lookupRes_occupied)._eq(1),
        targetOH_next(1)
    ).Elif((~sig_tables_1_lookupRes_occupied)._eq(1),
        targetOH_next(2)
    ).Elif(targetOH != 0,
        targetOH_next(Concat(sig_0, sig_1))
    ).Else(
        targetOH_next(2)
    ),
    insertFinal_next(sig_tables_0_lookupRes_found | sig_tables_1_lookupRes_found | ~sig_tables_0_lookupRes_occupied | ~sig_tables_1_lookupRes_occupied)
).Else(
    targetOH_next(targetOH),
    insertFinal_next(insertFinal)
)

If(clk._onRisingEdge(),
    If(rst_n._eq(0),
        insertFsm(insertFsm_t.idle),
        cleanupAddr(0)
    ).Else(
        insertFsm(insertFsm_next),
        cleanupAddr(cleanupAddr_next)
    )
)
